import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Dashboard from './pages/Dashboard';
import Events from './pages/Events';
import MyEvents from './pages/MyEvents';
import Profile from './pages/Profile';

function App() {
  const [searchTerm, setSearchTerm] = useState("");
  const [allEvents] = useState([
    {
      id: 1,
      title: "AI & Machine Learning Workshop",
      date: "Feb 15 · 10:00 AM",
      category: "Tech",
      image: "https://images.unsplash.com/photo-1591453089816-0fbb971b454c?auto=format&fit=crop&w=800&q=80"
    },
    {
      id: 2,
      title: "Annual Tech Fest 2026",
      date: "Feb 20 · 9:00 AM",
      category: "Fest",
      image: "https://images.unsplash.com/photo-1540575861501-7ad060e39fe5?auto=format&fit=crop&w=800&q=80"
    },
    {
      id: 3,
      title: "Cricket Tournament",
      date: "Feb 18 · 2:00 PM",
      category: "Sports",
      image: "https://images.unsplash.com/photo-1531415074968-036ba1b575da?auto=format&fit=crop&w=800&q=80"
    }
  ]);

  const filteredEvents = allEvents.filter(e => 
    e.title.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <Router>
      <Routes>
        <Route path="/" element={
          <Dashboard 
            events={filteredEvents} 
            searchTerm={searchTerm} 
            setSearchTerm={setSearchTerm} 
            regCount={3} 
          />
        } />
        <Route path="/events" element={<Events events={allEvents} searchTerm={searchTerm} setSearchTerm={setSearchTerm} />} />
        <Route path="/my-events" element={<MyEvents events={[]} />} />
        <Route path="/profile" element={<Profile />} />
      </Routes>
    </Router>
  );
}

export default App;
